// MainContainer.js

// -- Main imports
import React, { Component, Img } from 'react';
import App from '../App'
import { Menu, Icon, Layout, Breadcrumb, Row, Col } from 'antd';
import SpanContainer from './SpanContainer';
// -- Image Imports
import yo from '../imgs/yo.png';
import pete from '../imgs/pete.jpg';

// -- consts
const { Header, Content, Footer, Sider } = Layout;
const SubMenu = Menu.SubMenu;
const MenuItemGroup = Menu.ItemGroup;


class MainContainer extends Component {
  render () {
    return (
    <div>
    <Layout>
      <Row>
        <Col span={6} xs={2} sm={8} md={6} lg={8} xl={12}>
        <Content className="mainNonNav" style={{ margin: '0px 0px', padding: '24px, 0px, 24px, 0px' }}>
          <div style={{width: 1000, height: 1000, background: '#fff', minHeight: 280, paddingRight: 50, paddingLeft: 50, paddingTop: 25}}>
            <SpanContainer/>
          </div>
        </Content>
        </Col>
      </Row>
    </Layout>
    </div>
    );
  }
}

export default MainContainer;
